import $ from "jquery";

export default function Header() {
  //   $("#toggle").click(function () {
  //     $(this).toggleClass("on");
  //     $("#menu").slideToggle();
  //   });'
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  const handleToggle = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  return (
    <header>
      <nav>
        <div
          id="toggle"
          onClick={handleToggle}
          className={isMenuOpen ? "on" : ""}
        >
          <div class="one"></div>
          <div class="two"></div>
          <div class="three"></div>
        </div>

        <div id="menu">Hello, I'm a menu!</div>
      </nav>
    </header>
  );
}
